import { BrowserRouter as Router, Routes } from 'react-router-dom';
import Chat from './components/Chat';
import Join from './components/Join';

function App() {
    <Router>
        <Routes path="/" exact component={Join} />
        <Routes path="/chat" exact component={Chat} />
    </Router>;
}

export default App;
